name: Panasonic Pineapple Bread
servings: 10 servings
source: Panasonic
prep_time: 10 min
cook_time: 2 hr 15 min
categories: [Bread, Panasonic]
difficulty: Easy
nutritional_info: 174 calories
notes: |
  Use 5 ̊C cold water and reduce the amount of water by 10 g (mL) if the room temperature is above 25 ̊C.
  Put cookie dough in the refrigerator after it is made
  Roll the cookie dough flat when only 10 min of process work are left.
  If 取消 (Cancel) is accidentally pressed in Step 3. Press スタート (Start) within 10 min to recover it. (This can only be performed once. )
  Add different ingredients to make bread of different flavors in Step 3
ingredients: |
  150 g high gluten bread flour
  15  g butter
  17  g sugar
  6   g milk powder
  2.5 g salt
  90  g water
  2.1 g instant dry yeast

  for cookie crust:
  50  g   butter
  40  g   sugar
  25  g   eggs (evenly mixed)
  100 g   low gluten flour
  3   g   baking powder
  1   tsp vanilla extract
  2-3 tsp granulated sugar
directions: |
  Making Cookie Dough:
  Mix low-gluten flour and baking powder and shift them together.
  Use a wooden spoon to mix the butter at room temperature till it become creamy.
  Add granulated sugar in small quantities 2-3 times. Mix the butter after each addition till the butter becomes whitish and smooth
  Add eggs in small quantities 3-4 times. Fully mix after each addition. Finally, add the vanilla essence.
  Reserve 1⁄2 tsp of egg liquids.
  Add the powder mix in Step 1 and evenly mix them till the granules of powder disappear
  Make the dough a round shape, cover with plastic wrap and put it in the refrigerator for over 20 min.

  Rolling Cookie dough:
  Use a rolling pin to roll the dough into a flat circle with a diameter of 14-15cm
  Cover the dough with a plastic wrap for the convenience of rolling.
  Coat one side of the dough with the reserved egg liquids (1⁄2 tsp).
  You may also cut patterns on the surface of the cookie dough. Use a bamboo stick to cut patterns in a depth of not over 1 mm.
  The cookie dough may crack and slide down if the patterns are cut too deep.
  Do not put in the cookie dough before it is flexible and bendable enough. This helps the cookie dough to form a better shape


  Remove the bread pan and Set the kneading blade
  Add the ingredients other than the instant dry yeasts in the bread pan - high-gluten flour, water and other ingredients
  Add instant dry yeast into yeast dispenser
  Select menu “16” via the メニュー (Menu) rocker
  To add mixins, press レーズン:選択 (Raisin: Select) , Select あり (Yes) (make it flash) for automatic add - raisins, nuts, green beans or olives (<100g) or Select あり♪ (Yes♪) (make it flash) for manual add - macerated vegetables, fruits, cheese or chocolate, before Start
  To use gentle stir for easily crushed mixins, after the above, Press レーズン:混ぜ (Raisin:Stir) and select 粗混ぜ (make it flash) - needed for olives, green beans, cheese, chocolate or heated vegetables
  To change crust color, press 焼き色 (Crust), to select 淡 (Light), 標準 (Standard), 濃 (Dark)
  For delayed start, press 予約 (Timer), and then 時 (hours) and/or 分 (minutes) to adjust end time
  Press スタート (Start)
  When it beeps, open the lid and within 10 minutes. 
  Place the bread dough in the middle of the bread pan again.
  Place the cookie dough on the bread dough with the egg-coated side facing downward.
  Slightly press the sides of the dough (do not press hard)
  Sprinkle granulated sugar on top of the cookie dough.
  Do not press 取消 (Cancel)
  Press スタート (Start)
  Baking completes (Beep sound)
  Take out the bread pan and put it on a table with a towelette under it. When handling the bread pan, be sure to wear thick oven gloves.
  Cool down (about 2 min)
  Take out the bread for cooling down
